        <div class=""col-lg-6 pt-4 pt-lg-0"">
            <p>Langbiang là tên của một ngọn núi cách trung tâm thành phố Đà Lạt khoảng 12km, với bề dày lịch sử lâu đời, gắn liền với sự phát triển của du lịch. Ngọn núi gồm núi Ông cao khoảng 2.124 mét so với mực nước biển và núi Bà cao khoảng 2.167 mét. Ngoài ra, trong khuôn viên khu du lịch Langbiang còn ngọn núi thứ tư là đồi Radar, cao 1.929 mét. Vì thế nơi đây được mệnh danh là nóc nhà của Đà Lạt, du khách có thể thu gọn vào tầm mắt vẻ đẹp của cả thành phố mộng mơ.</p>
            <p>
                1.2. Truyền thuyết về đỉnh Langbiang<br />
                Về lịch sử, cái tên Langbiang gắn với rất nhiều những câu chuyện truyền thuyết. Nổi tiếng nhất phải kể đến là chuyện tình đầy bi thương của một chàng trai tên Lang và một cô gái tên Biang. Hai người đã đem lòng yêu thương nhau sau một lần tình cờ gặp gỡ và chàng lang đã cứu nàng Biang thoát khỏi tình huống hiểm nghèo.
                Thế nhưng vì hai người thuộc ");
            WriteLiteral(@"hai bộ lạc khác nhau, giữa hai bộ lạc lại có thù oán sâu nặng nên chuyện tình này đã gặp rất nhiều sự cấm cản. Cuối cùng hai người đã bất chấp tất cả, ngồi bên cạnh nhau vượt qua đêm lạnh giá, ngày nắng gắt, bên nhau đến trút hơi thở cuối cùng. Nước mắt của nàng Biang hòa cùng dòng thác, như nỗi đau vô tận của những người yêu nhau nhưng không thể bên cạnh nhau. Kể từ đây cái tên đỉnh Langbiang ra đời, cho đến tận ngày này vẫn lưu lưu truyền cùng câu chuyện tình yêu bi thương nhưng vô cùng cảm động. Đồng thời nơi đây cũng trở thành biểu tượng tình yêu và là sự lựa chọn của rất nhiều đôi lứa yêu nhau, muốn cùng nhau thề nguyền hẹn ước.
